import React from 'react';
import styled from 'styled-components';
import palette from '../../lib/styles/palette';



const BackTemplate= styled.div`

position:absolute;
left:0;
right:0;
top:0;
bottom:0;

background:${palette.gray[2]};
padding-left:10px;
padding-right:10px;
// display: flex;
// flex-direction: column;
// justify-content: center;
// align-items: center;


`;


const ContentBody=styled.div`
  
height:100%;
border-top:2rem;

display:flex;
flex-direction:row;
flex-wrap:nowrap; // 한줄에 표사
justify-content:flex-start;



`;


const WriteList=styled.div`

width:50%;
border-right:1px solid black;

display:flex;
flex-direction:row;
 align-items:center;
 justify-content:center;

`;


const WriteBox=styled.div`

input {

    height:50px;
    width:400px;

    font-size:1.5rem;
}

button{

    background:${palette.gray[9]};
    color:white;
    font-weight:bold;
    height:50px;
    width:100px;
  

}

`;



const WriteSchedule=()=>{



    return(

        <BackTemplate> 

        <ContentBody>

        <WriteList>

            <WriteBox>
                <input />
                <button>등록 </button>
                
                </WriteBox> 
            
            
            
            

             </WriteList>


        </ContentBody>


        </BackTemplate>


    );


}



export default WriteSchedule;
